m/m4v/flac','Min length (seconds)'=>'Duración mínima (segundos)','Max length (seconds)'=>'Longitud máxima (segundos)','Order sub total percentage discount'=>'Descuento del porcentaje subtotal del pedido','If at least one upload has been performed, a percentage discount will be applied to the order sub total.'=>'Si se ha realizado al menos un upload, se aplicará un descuento porcentual al subtotal del pedido.','Percentage'=>'Porcentaje','This is the percentage discount applied to sub total.'=>'Este es el descuento porcentual aplicado al subtotal.','Discount description to show on cart'=>'Descripción del descuento a mostrar en el carrito','If left black will be used as description the upload field name. Use the <strong>%field_title</strong> placeholder to print the upload field title inside the discount description.'=>'Si se deja en negro se utilizará como descripción el nombre del campo de carga. Utilice el marcador de posición <strong>%field_title</strong> para imprimir el título del campo de carga dentro de la descripción del descuento.','Discount for %field_title'=>'Descuento por %field_title','Apply only once'=>'Aplicar sólo una vez','Enable this option if you do not want to apply the order sub total discount if another upload field already has.'=>'Habilite esta opción si no desea aplicar el descuento del subtotal del pedido si ya existe otro campo de upload.','Cart fee/discount'=>'Tarifa/descuento de la cesta','For each uploaded file the plugin will compute additional costs according the following options. The extra costs will be added to cart as fee.'=>'Para cada archivo cargado, el plugin calculará los costes adicionales de acuerdo con las siguientes opciones. Los costes adicionales se añadirán al carrito en concepto de tarifa.','Overcharge type'=>'Clase de sobrecarga','<strong>NOTE:</strong> <strong>Percentage</strong> option will work with Variations/Variable products, only if: <ol><li><strong>Display the upload field for every product variation</strong> option has been enabled</li></ol>'=>'<strong>NOTA:</strong>la opción<strong>Porcentaje</strong>funcionará con variaciones / productos variables, solo si: <ol><li><strong>Mostrar el campo de carga para cada variación de producto</strong>se ha habilitado la opción</li></ol>','Fixed value'=>'Valor fijo','Percentage of item price'=>'Porcentaje del precio del artículo','Value'=>'Valor','This will be the percentage or the fixed value added/subtracted to the original item price. Using <strong>negative</strong> values, the fixed/percentage value will be subtracted to the cart (applying then a <strong>discount</strong>).'=>'Este será el porcentaje o el valor fijo añadido/restaurado al precio original del artículo. Utilizando valores <strong>negativo</strong>, el valor fijo/porcentaje se restará al carro (aplicando entonces un <strong>descuento</strong>).','Fee/Discount description to show on cart'=>'Descripción de la tarifa/descuento a mostrar en el carrito','If left black will be used as description the upload field name. Use the <strong>%prod_name</strong> placeholder to print the product name and the <strong>%field_title</strong> placeholder to print the upload field title inside the fee description.'=>'Si se deja en negro se utilizará como descripción el nombre del campo de carga. Utilice el marcador de posición <strong>%prod_name</strong> para imprimir el nombre del producto y el marcador de posición <strong>%field_title</strong> para imprimir el título del campo de carga dentro de la descripción de la tarifa.','Extra costs %field_title for %prod_name'=>'Costes adicionales %Título_de_campo para %Nombre_de_la_producción','Note that in case of negative values (discount) due to a WooCommerce bug, the fee will be always taxes included.'=>'Tenga en cuenta que en caso de valores negativos (descuento) debido a un error de WooCommerce, la tarifa será siempre impuestos incluidos.','Apply extra costs/discount considering the item cart quantity'=>'Aplicar costes/descuentos adicionales teniendo en cuenta la cantidad de artículos del carrito','Detect <span class="wcuf_pdf_label">PDF</span>'=>'Detectar <span class="wcuf_pdf_label">PDF</span>','The extra costs will be applied to each detected page.'=>'Los costes adicionales se aplicarán a cada página detectada.','Overcharge uploads limit'=>'Límite de subidas de sobrecarga','In case of PDF detection: this will option will be applied to pages and in case di multiple uploads, extra cost pages limit is considered globally per field and not per each pdf.'=>'En caso de detección de PDF: esta opción se aplicará a las páginas y en caso de múltiples cargas, el límite de páginas de costo adicional se considera globalmente por campo y no por cada pdf.','Free items'=>'Artículos gratis','Leave 0 for no free items. This option works only if the <strong>Multiple files upload per single field</strong> option has been enabled. For the first N uploads will not be applied any extra cost (where N is the value specified using the following number field). '=>'No deje 0 para ningún artículo gratis. Esta opción sólo funciona si la opción <strong>Múltiples archivos cargados por campo individual</strong> ha sido habilitada. Para las primeras cargas de N no se aplicará ningún coste adicional (donde N es el valor especificado utilizando el siguiente campo numérico). ','In case of PDF detection: this will be considered as "free pages number" and in case di multiple uploads, free pages are computed globally per field and not per each pdf.'=>'En caso de detección de PDF: esto será considerado como "número de páginas libres" y en caso de múltiples cargas, las páginas libres se calculan globalmente por campo y no por cada pdf.','Fee per second'=>'Tarifa por segundo','These option will apply <strong>only for Video/Audio files</strong>. WCUF will try do detect media file the duration (in seconds) extracting the info from its ID3 data (if any and well encoded). For each detected second the plugin will compute the extra costs according the following options.'=>'Esta opción se aplicará <strong>sólo para archivos de Vídeo/Audio</strong>. WCUF tratará de detectar el archivo de medios la duración (en segundos) extrayendo la información de sus datos ID3 (si los hay y están bien codificados). Por cada segundo detectado, el plugin calculará los costes adicionales de acuerdo con las siguientes opciones.','The computed extra cost will be added as Cart fee.'=>'El coste adicional calculado se añadirá como tarifa de carro.','An extra text will be added reporting how much costs a second.'=>'Se agregará un texto extra para informar de cuánto cuesta un segundo.','Cost per second'=>'Coste por segundo','This is the cost per each detected second.'=>'Este es el costo por cada segundo detectado.','Maximun seconds overcharge limit'=>'Límite máximo de sobrecarga en segundos','Free seconds'=>'Segundos gratis','First N seconds can be free, set the desidered values. Leave 0 for no free seconds.'=>'Los primeros N segundos pueden ser libres, ajuste los valores deseados. Deje 0 por ningún segundo libre.','Product cart price'=>'Precio del carrito del producto','The computed fee will be used as product cart price'=>'La tarifa calculada se utilizará como precio del carrito del producto','The computed fee will be added to product cart price'=>'La tarifa calculada se añadirá al precio del carrito del producto','DropBox account unlinked'=>'Cuenta de DropBox desvinculada','Invalid image path'=>'Ruta de imagen no válida','Cannot create thumb'=>'No se puede crear el pulgar','Variation'=>'Variación','To use this you have to disable the standard upload field managment for Product page. Go to the Plugin options page and disable it.'=>'Para utilizarlo, debe desactivar la gestión de campos de upload estándar para la página Producto. Ve a la página de opciones de plugin y desactívalo.','To use this you have to disable the standard upload field managment for Cart page. Go to the Plugin options page and disable it.'=>'Para utilizarlo, debe desactivar la gestión de campos de upload estándar para la página Carro. Ve a la página de opciones de plugin y desactívalo.','To use this you have to disable the standard upload field managment for Checkout page. Go to the Plugin options page and disable it.'=>'Para utilizarlo, debe desactivar la gestión de campos de upload estándar para la página Checkout. Ve a la página de opciones de plugin y desactívalo.','You have no orders or you are not logged'=>'No tiene pedidos o no está registrado','Free!'=>'¡Gratis!',' (seconds cost)'=>' (segundos de costo)',' (cost per upload)'=>' (costo por subida)','Cost: '=>'Costo: ','Length: '=>'Duración: ','Download / View file'=>'Descargar / Ver archivo','#'=>'#','Browse'=>'Buscar','Add files'=>'Agregar archivos','Click to choose the file or drag it here'=>'Haga clic para elegir el archivo o arrástrelo aquí','Click to choose the files or drag them here'=>'Haga clic para elegir los archivos o arrástrelos aquí','Upload selected files'=>'Cargar los archivos seleccionados','Delete uploaded file(s)'=>'Eliminar archivo(s) cargado(s)','Crop & Upload'=>'Recortar y cargar','Crop & Save'=>'Recortar & guardar','Rotate left'=>'Girar a la izquierda','Rotate right'=>'Girar a la derecha','Deleting file, please wait...'=>'Borrando fichero, por favor espere...','Loading, please wait...'=>'Cargando, espere por favor...','Save in progress, please wait...'=>'Guardar en progreso, por favor espere....','Totals'=>'Totales','Number of uploaded files:'=>'Número de archivos cargados:','Extra costs:'=>'Costes adicionales:','Save upload(s)'=>'Guardar upload(s)','Select quantity:'=>'Seleccione la cantidad:','Your file upload is incomplete – click on the \'Upload selected files\' button or remove the file(s)'=>'Su carga de archivos está incompleta - haga clic en el botón\'Cargar archivos seleccionados\' o elimine el archivo(s)','Please upload all the required file(s). Once done you will be able to add the product to cart.'=>'Por favor, cargue todos los archiv